func TestSearch(t *testing.T) {
	for i, test := range tests {
		t.Log("test ", i+1)

		got := searchv2(test.nums, test.target)
		assert.Equal(t, test.expected, got)

		t.Log("got: ", got, ", expected: ", test.nums)
	}
}

func BenchmarkSearch(b *testing.B) {
	funcs := []struct {
		name string
		f    func([]int, int) int
	}{
		{"mine", search},
		{"mine-v2", searchv2},
		{"leet-17ms", search_leet17ms},
	}

	var res int
	for _, fun := range funcs {

		b.Run(fun.name, func(b *testing.B) {
			b.ReportAllocs()
			b.ResetTimer()
			for k := 0; k < b.N; k++ {
				res = fun.f(tests[k%7].nums, tests[k%7].target)
			}

		})
	}

	result = res
}
